      // 9600 baud, 8-bits, NO stop 
void UART1_poll_Init(void){
	SYSCTL_RCGCUART_R |= 0x02; //UART 1
	SYSCTL_RCGCGPIO_R |=  0x02; // PORT B
	UART1_CTL_R = 0;
	UART1_IBRD_R =520;  
	UART1_FBRD_R = 53;
	UART1_CC_R = 0;
	UART1_LCRH_R |= 0x60;
	UART1_CTL_R |= 0x300;
	UART1_CTL_R |= 1;
	
	GPIO_PORTB_DEN_R |= 3;
	GPIO_PORTB_AFSEL_R |= 3;
	GPIO_PORTB_PCTL_R |= 0x00000011;
	
}

void UART1_poll_Tx(uint8_t ByteToSend){
  while((UART1_FR_R & UART_FR_TXFF) != 0);
    UART1_DR_R = ByteToSend;
}

uint8_t UART1_poll_Rx(void){
  while((UART1_FR_R & UART_FR_RXFE) != 0);
  return UART1_DR_R;
}

void UART_Transmit_String(const uint8_t *MessageString){
  while(*MessageString){ // while there is a character
    UART1_poll_Tx(*MessageString); //send character
    MessageString++;
  }
}


/////////////////////////////////////////////////////////25us Timer1A
 
 void Timer1A_Init(void){  // 25 microSeconds 
	// Timer1A configuration
	SYSCTL_RCGCTIMER_R |= 0x02;	// enable clock to timer Block 1
	TIMER1_CTL_R = 0;						// disable Timer1 during configuration
	TIMER1_CFG_R = 0x04;				// 16-bit timer
	TIMER1_TAMR_R = 0x02;				// periodic countdown mode
	//TIMER1_TAPR_R = 250;				// 16MHz/250 = 64kHz
	TIMER1_TAILR_R = 2000;			// 80MHz/2kHz = 40Hz   period = 25 microSeconds
	TIMER1_ICR_R = 0x1;					// clear Timer1A timeout flag
	TIMER1_IMR_R |= 0x01;				// enable Timer1A timeout interrupt 
	TIMER1_CTL_R |= 0x01;				// enable Timer1A
	NVIC_EN0_R |= 0x00200000;		// enable IRQ21
}


void PORTB_INIT(){ //PB4 INPUT
    volatile uint32_t delay;
  SYSCTL_RCGCGPIO_R |= 0x02;  // enable clock to PORTB

  delay = SYSCTL_RCGCGPIO_R;        // allow time for clock to start

  GPIO_PORTB_DIR_R &= ~0x10;   // PB4 IS INPUT
  GPIO_PORTB_DEN_R |= 0x10;   // PB4 is digital

  GPIO_PORTB_DIR_R |= 0x20;   // PB0 IS output to be scoped to verify timer
  GPIO_PORTB_DEN_R |= 0x20;   // PB0 is digital
  
 /// Configure PB1 for both edge interrupt
  GPIO_PORTB_IS_R &= ~0x10;   // PB2 is edge sensitive IT COULD OF BEEN LEVEL SENSITIVE

  GPIO_PORTB_IBE_R &= ~0x10;      // trigger is controlled by IEV
  GPIO_PORTB_IEV_R &= ~0x10;      // falling edge trigger

  GPIO_PORTB_ICR_R |= 0x10;   // clear PB2 interrupt flag
  GPIO_PORTB_IM_R |= 0x10;    // unmask interrupt
  
  NVIC_PRI1_R = 5 << 5;       // set interrupt priority to 5
  
  NVIC_EN0_R |= 0x00000002;   // enable IRQ1 for PortB
  

}

void DelayWait10ms(uint32_t n){uint32_t volatile time;
  while(n){
    time = 727240*2/91;  // 10msec
    while(time){
	  	time--;
    }
    n--;
  }
}


